import { Platform } from '@ionic/angular';
import { Component, ViewChild, OnInit, ElementRef, AfterViewInit } from '@angular/core';
import { Report } from './report';
import { ReportDataService } from '../services/report-data.service';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;
import { Plugins, FilesystemEncoding, FilesystemDirectory } from '@capacitor/core';
const { Filesystem } = Plugins;
import { Chart } from 'chart.js';


@Component({
  selector: 'app-report',
  templateUrl: './report.page.html',
  styleUrls: ['./report.page.scss'],
})

export class ReportPage implements OnInit, AfterViewInit {

  @ViewChild('radonCanvas') radonCanvas: ElementRef;

  radonChart: Chart;
  context: CanvasRenderingContext2D;

  report: Report;
  pdfObj: any;
  location: string;
  readings: any[] = [[{ colSpan: 12, text: 'Hourly Readings:' }, '', '', '', '', '', '', '', '', '', '', '']];
  graphData: number[] = [];
  constructor(
    private reportData: ReportDataService,
    private platform: Platform,

  ) { }

  ngOnInit() {
    this.report = this.reportData.report;
    console.table(this.report.data);
    this.location = this.report.address.trim().replace(/\s|,|-|\.|\/|\\,/g, '_').replace(/\_+/g, '_') + '.pdf';
    const graphData = [];
    for (let i = 0; i < 4; i++) {
      const row = [];
      for (let j = 0; j < 12; j++) {
        if (this.report.data[(i * j) + j]) {
          row.push({ text: this.report.data[(i * j) + j].radon.toFixed(2).toString(), alignment: 'center', fontSize: 10 });
          graphData.push(this.report.data[(i * j) + j].radon);
        }
        else { this.readings.push(''); }
      }
      this.readings.push(row);
      this.graphData = graphData;
      console.log(JSON.stringify(this.readings));
      console.table(this.readings);

    }
    this.createPdf();
  }

  ngAfterViewInit(){
    this.context = (this.radonCanvas.nativeElement as HTMLCanvasElement).getContext('2d');
    this.radonChart = new Chart(this.radonCanvas.nativeElement, this.generateConfig() );
    this.radonChart.config = this.generateConfig();
    this.radonChart.update();
  }

  createPdf() {
    let date = this.report.startTime;
    const startTimeString = `${String(date.getMonth() + 1).padStart(2, '0')}\/${String(date.getDate()).padStart(2, '0')}\/${date.getFullYear()}  ${date.getHours()}:${String(date.getMinutes()).padStart(2, '0')}`;
    date = this.report.endTime;
    const endTimeString = `${String(date.getMonth() + 1).padStart(2, '0')}\/${String(date.getDate()).padStart(2, '0')}\/${date.getFullYear()}  ${date.getHours()}:${String(date.getMinutes()).padStart(2, '0')}`;
    let resultsString;
    if (this.report.result) { resultsString = ' Results were below 4.0 pCi/l, and appear to be safe.'; }
    else { resultsString = 'With the results being above 4.0 pCi/l, we recommend to have a Radon Mitigation Contractor out to advise you on installation of a mitigation system.'; }


    const report = {
      pageSize: 'LETTER',
      background: [
        {
          image: 'logo',
          width: 500,
          opacity: 0.2,
          absolutePosition: { x: 60, y: 175 },

        }
      ],
      content: [
        {
          layout: 'noBorders',
          table: { // HEADER TABLE
            widths: ['33%', '34%', '33%'],
            body: [
              [
                {
                  rowSpan: 4,
                  image: 'logoCropped',
                  fit: [166, 166]
                },
                { colSpan: 2, text: 'Radon Testing Results', fontSize: 17 },
                '',
              ],
              [
                '',
                `${this.report.address}`,
                { text: 'Nook & Kranny Inspections\nClearifeld, Utah 84015\n801-698-6467', alignment: 'right', fontSize: 10 }
              ],
              [
                '',
                '',

                ''
              ],
              [
                '',
                { // LINE BREAK
                  colSpan: 2,
                  layout: 'noBorders',
                  table: {
                    widths: ['50%', '50%'],
                    body: [
                      [
                        {
                          colSpan: 2,
                          text:
                            `The results of the radon test show average levels of ${this.report.average} pCi/l.
                        The results are shown below.
                        The EPA recommends mitigation of radon for any levels above 4.0 pCi/l.
                        ${resultsString}`,
                          fontSize: 10
                        },
                        ' '
                      ]
                    ]

                  }
                },
                ' '
              ]
            ]

          } // HEADER TABLE

        },
        '',

        {
          margin: [0, 5, 0, 0],
          layout: 'noBorders',
          table: { // HEADER TABLE
            widths: ['25%', '25%', '10%', '20%', '20%'],
            body: [
              [
                'Start: ',
                'End: ',
                '',
                { text: 'Inspector: ', alignment: 'left' },
                { text: 'Serial:', alignment: 'right' },

              ],
              [
                `${startTimeString}`,
                `${endTimeString}`,
                '',
                { text: `${this.report.inspector}`, alignment: 'left' },
                { text: `${this.report.serial}`, alignment: 'right' },

              ],
            ]

          } // HEADER TABLE
        },
'', //HEADER TABLE
        {
          margin: [0, 5, 0, 0],
          layout: 'noBorders',
          table: { // HEADER TABLE
            widths: ['8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%', '8.33%'],
            body: this.readings

          } // HEADER TABLE
        },
'',
        {
          margin: [0, 5, 0, 0],
          layout: 'noBorders',
          table: {
            widths: ['45%', '10%', '45%'],
            body: [
              [
                { rowSpan: 2, text: 'Test Result: Pass', fontSize: 15, alignment: 'right' },
                '',
                { rowSpan: 2, text: `Overall Average: ${this.report.average}`, fontSize: 15, alignment: 'left' },

              ],
              [
                '',

                ''
              ]
            ]

          }
        },
        {

        },
        {
          image: 'logo',
          width: 515,
          height: 400
        }, // GRAPH IMAGE
        '',

      ],
      images: {
        logo: 'data:image/png;base64,',
        logoCropped: 'data:image/png;base64,'
      }
    };
    this.pdfObj = pdfMake.createPdf(report);
    this.savePdf();
  }

  async savePdf() {
    this.pdfObj.getBuffer((buffer) => {
      const blob = new Blob([buffer], { type: 'application/pdf' });
      this.fileWrite(blob);
    });
  }

  async fileWrite(blob) {
    try {
      const base64blob = await this.convertBlobToBase64(blob) as string;
      console.table(this.platform.platforms);
      if (!this.platform.is('capacitor')) {
        this.pdfObj.download();
      } else {
        const result = await Filesystem.writeFile({
          path: 'Download/' + this.report.address + '.pdf',
          data: base64blob,
          directory: FilesystemDirectory.ExternalStorage
        });
      }

      navigator['app'].exitApp();

    } catch (e) {
      console.error('Unable to write file', e);
    }
  }

  convertBlobToBase64 = (blob: Blob) => new Promise((resolve, reject) => {
    const reader = new FileReader();
    reader.onerror = reject;
    reader.onload = () => {
      resolve(reader.result);
    };
    reader.readAsDataURL(blob);
  })

  formatData(dataSet) {
    const coords = [];
    coords.push(this.report.average);
    for (let i = 0; dataSet.length > i; i++) {
        coords.push({
            x: i,
            y: dataSet[i]
        });
    }
    return coords;
  }
  createPinstripeCanvas(color) {
    const ctx = this.context;
    const p = document.createElement('canvas');
    p.width = 16;
    p.height = 16;
    const pctx = p.getContext('2d');

    const x0 = 0;
    const x1 = 18;
    const y0 = 17;
    const y1 = -1;
    const offset = 8;

    pctx.strokeStyle = color;
    pctx.lineWidth = 1;
    pctx.beginPath();
    pctx.moveTo(x0, y0);
    pctx.lineTo(x1, y1);
    pctx.moveTo(x0 - offset, y0);
    pctx.lineTo(x1 - offset, y1);
    pctx.moveTo(x0 + offset, y0);
    pctx.lineTo(x1 + offset, y1);
    pctx.moveTo(x0 - offset * 2, y0);
    pctx.lineTo(x1 - offset * 2, y1);
    pctx.stroke();
    return ctx.createPattern(p, 'repeat');
  }
  generateConfig(): Chart.ChartConfiguration{
    return {
      type: 'line',

      data: {
          datasets: [{
              label: 'Max',
              data: Array.from({ length: this.graphData.length + 1 }, (v, i) => 4 )
              ,
              backgroundColor: 'rgba(0,0,0,0)',
              borderColor: this.report.average >= 4.0 ? '#FF0000': '#00ff00',
              borderWidth: 3,
              radius: 0

          }, {
              label: 'pCi/l',
              data: this.formatData(this.graphData),
              backgroundColor: 'rgba(43,49,69, 0.25 )',
              borderColor: '#2b3145',
              borderWidth: 3,
              radius: 2


          }, {

              label: 'Average',
              data: Array.from({ length: this.graphData.length + 1 }, (v, i) => this.report.average)
              ,
              backgroundColor: this.createPinstripeCanvas('#FF6600'),
              borderColor: '#FF6600',
              borderWidth: 1.5,
              radius: 0



          }],
          labels: Array.from({ length: 49 }, (v, i) => i.toString())

      },
      options: {
        animation: {
          duration: 0 // general animation time
        },
        aspectRatio: 1,
        legend: {
            position: 'bottom',
            labels: {
                fontSize: 16
            }
        },

        scales: {
            xAxes: [{
                scaleLabel: {
                    display: true,
                    labelString: "Hours Past"
                },
                ticks: {
                    min: 0,
                    maxTicksLimit: 11,
                    stepSize: 4
                }
            }],
            yAxes: [{
                scaleLabel: {
                    display: true,
                    labelString: "Radon in pCi/l"
                },
                ticks: {
                    min: 0,
                },
                stacked: false
            }]
        }
      }
    }
  }
}
